import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Type "travel" into the main search input
    const searchInputSelector = '#mainSearchInput';
    await page.waitForSelector(searchInputSelector);
    await page.fill(searchInputSelector, 'travel');

    // Wait for the search results dropdown to appear
    const searchResultsSelector = '.search-results';
    await page.waitForSelector(searchResultsSelector);

    // Take screenshot after typing
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_typing.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_typing.png'));

    // Verify that the search dropdown appears
    const searchDropdownVisible = await page.isVisible(searchResultsSelector);

    return {
      success: searchDropdownVisible,
      action: searchDropdownVisible ? "Search dropdown appeared successfully" : "Search dropdown did not appear",
      extractedData: {},
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
